import React from "react";
import { Dropdown, Label, Image } from "semantic-ui-react";
import "cors";

const items = [
  "My Profile",
  "Configuration Notification",
  "Extensions",
  "Log out",
];

const Profile = () => (
  <Dropdown
    className="notification navbarItem profile"
    icon={
      <Label as="a" image style={{ height: "100%" }}>
        <Image
          size="big"
          src="https://picsum.photos/50/50"
          style={{ height: "100%", paddingTop: "8px" }}
        />
        <span style={{ height: "100%", fontSize: "16px", fontWeight: "200" }}>
          Paul Walker
        </span>
      </Label>
    }
  >
    <Dropdown.Menu>
      {items.map((item, id) => (
        <Dropdown.Item key={item + id}>{item}</Dropdown.Item>
      ))}
    </Dropdown.Menu>
  </Dropdown>
);

export default Profile;
